webpackJsonp([0xfc3c494022a6],{1371:function(a,e){a.exports={data:{markdownRemark:{html:'<p>私は早朝に「最も神秘的な戦争」を読んで初めを読んで、中国軍とビルマ軍のKMT残党に対する共同行動について話しました。しかし、私はいつもそれがあまりよく書かれていないと感じています。執筆はちょっと面白く、壮大です。私はプレーンで魔法を見ませんでしたが、私は意図的に大きなことを書いていました。歴史的事実は貴重です。</p>\n<p>私はすぐに "93中国開発報告書"の紹介を書きます。導入のテーマは次のとおりです。世界の再認識。レポート全体と同じです。それは、国際、政治、経済、文化、社会に対応する6つの部分に分かれています。このレポートを書くことは、中国社会の発展をより深く理解しており、資料も多くのことを把握しています。</p>\n<p>途中で、誰もが "王子の言葉を集めて"と言っていると言って、誰も議論して議論していたと言っていた： "チャンジャンは、子供が話すことはないと主張する。悪役は言葉で主張する。</p>',id:"/home/swain/workspace/political-life/src/pages/ja/0022.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0022.md",frontmatter:{title:"2月1日 火曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0022.md absPath of file >>> MarkdownRemark"}}}});
